import React from 'react';
import Button from './components/IButton';

const App: React.FC = () => {
  const handleClick = () => {
    console.log('Botón clickeado');
  };

  return (
    <div>
      <IButton text="Haz clic aquí" onClick={handleClick} />
    </div>
  );

};

export default App;
